import React from "react";

import Card from "../UI/Card/Card";

const MountainDetails = (props) => {
  return (
    <Card>
      <div>
        <h1>Mountain details for {props.name}</h1>
        <p>Altitude: {props.altitude}</p>
      </div>
    </Card>
  );
};

export default MountainDetails;
